eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   pressItems: () => (/* binding */ pressItems)\n/* harmony export */ });\nconst pressItems = [\n    {\n        id: 1,\n        title: \"Pioneirismo no Brasil: Dr. Thomas Benson \\xe9 refer\\xeancia na imprensa desde 2021.\",\n        href: \"/assets/images/press/news-1.jpg\",\n        src: \"/assets/images/press/news-1.jpg\",\n        externalLink: \"https://noticias.r7.com/cidades/folha-vitoria/cirurgiao-plastico-thomas-benson-tem-titulo-da-europa-reconhecido-no-brasil-06042022/\",\n        alt: \"Dr. Thomas Benson \\xe9 refer\\xeancia na imprensa desde 2021\",\n        video: \" \",\n        article: `<p>Especialista em cirurgia da face, o médico Thomas Benson, formado pela Universidade de Hamburgo, é agora \r\n    o único brasileiro com título de especialista pelo European Board of Plastic Surgery, do Conselho Europeu de Cirurgia \r\n    Plástica. Na ocasião, a especialização foi feita na Alemanha e outros países da Europa e validada no Brasil.\r\n    </p>\r\n    \r\n    <p>O diploma médico alemão do cirurgião já havia sido reconhecido pela Universidade de São Paulo (USP) e, hoje, ele \r\n    também interage com a cirurgia plástica de outra forma. Atualmente, Thomas participa até como voluntário em reconstruções \r\n    mamárias que são realizadas no Albert Einstein.\r\n    </p>\r\n    \r\n    <p>Clique no botão abaixo para continuar lendo esta matéria no R7.\r\n    </p>\r\n    <br/>`,\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 2,\n        title: \"Destaque no Brasil com s\\xe9rie ao vivo na Record em 2021 no programa 'O Hospital'.\",\n        href: \"/assets/images/press/news-2.jpg\",\n        src: \"/assets/images/press/news-2.jpg\",\n        externalLink: \"https://noticias.r7.com/jr-na-tv/videos/o-hospital-estreia-na-record-tv-com-a-rotina-de-medicos-e-pacientes-em-momento-critico-da-pandemia-06062022/\",\n        alt: \"Dr. Thomas Benson na s\\xe9rie 'O Hospital'\",\n        video: \" \",\n        article: `<p>Com episódios em formato de reality, <em>O Hospital</em> registra os bastidores do Hospital Moriah, um dos maiores \r\n    da América Latina e referência por seus procedimentos avançados.\r\n    </p>\r\n    \r\n    <p>A série documental tem chamado a atenção do público ao destacar a dedicação, as fragilidades, perdas e conquistas dos \r\n    profissionais da área da saúde.\r\n    </p>\r\n    \r\n    <p>Clique no botão abaixo para continuar lendo esta matéria no R7.\r\n    </p>\r\n    <br/>`,\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 3,\n        title: \"Deep Plane Facelift: Dr. Thomas Benson \\xe9 destaque no Domingo Espetacular.\",\n        href: \"/assets/images/press/news-3.jpg\",\n        src: \"/assets/images/press/news-3.jpg\",\n        externalLink: \"https://istoe.com.br/dr-thomas-benson-explica-como-funciona-a-cirurgia-plastica-facial-que-e-febre-nos-eua/\",\n        alt: \"Dr. Thomas Benson \\xe9 destaque no Domingo Espetacular falando sobre 'Deep Plane Facelift'\",\n        video: \" \",\n        article: `<p>Procedimentos de harmonização facial nunca estiveram tão em evidência como na atualidade. Entre outras \r\n    razões, as redes sociais e as chamadas de vídeo, impulsionadas pelo trabalho remoto durante a pandemia, fizeram com \r\n    que intervenções estéticas no rosto crescessem 13,9% na comparação entre os biênios 2018-2019 e 2020-2021, de acordo \r\n    com a Sociedade Internacional de Cirurgia Plástica e Estética (ISAPS).\r\n    </p>\r\n    \r\n    <p>Para falar do assunto, o ‘Domingo Espetacular’, da TV Record, entrevistou o Dr. Thomas Benson. Em programa que foi \r\n    ao ar na noite desse domingo (20), o cirurgião plástico explicou como funciona o ‘deep plane facelift’, cirurgia facial \r\n    mais avançada do mundo, e que é febre nos Estados Unidos.\r\n    </p>\r\n    \r\n    <p>Clique no botão abaixo para continuar lendo esta matéria na IstoÉ.\r\n    </p>\r\n    <br/>`,\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 4,\n        title: \"Celebridades fazem procedimentos e s\\xe3o atacados nas redes sociais.\",\n        href: \"/assets/images/press/news-4.jpg\",\n        src: \"/assets/images/press/news-4.jpg\",\n        alt: \"Dr. Thomas Benson fala sobre procedimentos de celebridades\",\n        video: \"https://www.youtube.com/embed/9CxtRdPJspg?si=2wai0ghr_BA_F_a5\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 5,\n        title: \"Conselho Federal de Medicina autoriza a divulga\\xe7\\xe3o de fotos de 'antes e depois' de procedimentos.\",\n        href: \"/assets/images/press/news-5.jpg\",\n        src: \"/assets/images/press/news-5.jpg\",\n        alt: \"Dr. Thomas Benson fala sobre autoriza\\xe7\\xe3o do Conselho Federal de Medicina sobre divulga\\xe7\\xe3o de 'antes e depois'\",\n        video: \"https://www.youtube.com/embed/etY92Tn6Z68?si=fkNAhaY2qw_iS3kc\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 6,\n        title: \"Novas regras para publicidade m\\xe9dica.\",\n        href: \"/assets/images/press/news-6.jpg\",\n        src: \"/assets/images/press/news-6.jpg\",\n        alt: \"Dr. Thomas Benson comenta as novas regras para publicidade m\\xe9dica\",\n        video: \"https://www.youtube.com/embed/DEQHc9o9k3Q?si=2CcHfGDxE0Cyo6pC\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 7,\n        title: \"Procedimentos est\\xe9ticos no rosto ficam em alta na pandemia.\",\n        href: \"/assets/images/press/news-7.jpg\",\n        src: \"/assets/images/press/news-7.jpg\",\n        alt: \"Dr. Thomas Benson sobre a alta dos procedimentos est\\xe9ticos no rosto durante a pandemia\",\n        video: \"https://www.youtube.com/embed/Gk7SNuz0Aa4?si=h4PLvq-TNgQ72hpL\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 8,\n        title: \"PORTAL ETC - Dr Thomas Benson: o melhor cirurgi\\xe3o pl\\xe1stico da face da Am\\xe9rica Latina.\",\n        href: \"/assets/images/press/news-8.jpg\",\n        src: \"/assets/images/press/news-8.jpg\",\n        externalLink: \"https://portaletc.com/dr-thomas-benson-o-melhor-cirurgiao-plastico-da-face-da-america-latina.html\",\n        alt: \"Dr Thomas Benson: o melhor cirurgi\\xe3o pl\\xe1stico da face da Am\\xe9rica Latina\",\n        video: \" \",\n        article: `<p>O cirurgião plástico paulistano, Dr Thomas Benson, é especialista em face. Ele é o único brasileiro \r\n    com título de especialização do Conselho Europeu de Cirurgia Plástica e da Sociedade Alemã de Cirurgia Plástica. \r\n    Além disso, também tem títulos de especialização pelas Sociedades Brasileira e Americana de Cirurgia Plástica.\r\n    </p>\r\n    \r\n    <p>Ele acaba de receber o prêmio de Profissional de Qualidade, na categoria ‘Cirurgião Plástico’ 2020. Essa premiação \r\n    reconhece os profissionais que se destacaram em sua área de atuação no último ano. Dr Benson é formado pela USP e pela \r\n    Universidade de Hamburgo (Alemanha), e faz sucesso na internet com mais de 100 mil seguidores no Instagram.\r\n    </p>\r\n    \r\n    <p>Ele é tão talentoso que sua agenda está completamente lotada. Mas todos os sonhos, e trabalho, só são possíveis, \r\n    por conta do apoio que recebe da família. Para ele, sua esposa e sua filha, são a base de tudo na vida.\r\n    </p>\r\n    <br/>`,\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 9,\n        title: \"Rinoplastia - Domingo Espetacular.\",\n        href: \"/assets/images/press/news-9.jpg\",\n        src: \"/assets/images/press/news-9.jpg\",\n        alt: \"Dr. Thomas Benson fala sobre Rinoplastia no 'Domingo Espetacular'\",\n        video: \"https://player.r7.com/video/i/532f69c8a4fd549981005281\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 10,\n        title: \"Dr. Thomas Benson - Sa\\xfade: Lipoenxertia - Programa Mulheres.\",\n        href: \"/assets/images/press/news-10.jpg\",\n        src: \"/assets/images/press/news-10.jpg\",\n        alt: \"Dr. Thomas Benson sobre Lipoenxertia\",\n        video: \"https://www.youtube.com/embed/tZBnQ_zfFvY?si=LuBe68ZeLa-tsyCI\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 11,\n        title: \"321 - Thomas Benson & Rafael de La Lastra.\",\n        href: \"/assets/images/press/news-11.jpg\",\n        src: \"/assets/images/press/news-11.jpg\",\n        alt: \"Thomas Benson & Rafael de La Lastra\",\n        video: \"https://www.youtube.com/embed/8uX0j0-5rqI?si=spJt-Za-fOXygM2V\",\n        categories: [\n            \"development\"\n        ]\n    },\n    {\n        id: 12,\n        title: \"Pl\\xe1stica com know-how internacional em Alphaville - Revista Vero.\",\n        href: \"/assets/images/press/news-12.jpg\",\n        src: \"/assets/images/press/news-12.jpg\",\n        externalLink: \"http://issuu.com/veroalphaville3/docs/vr185/64\",\n        alt: \"Dr. Thomas Benson para a revista 'Vero'\",\n        video: \" \",\n        article: `<p>Às vezes, a gente até esquece. Mas, muitas vezes, os benefícios da cirurgia plástica estão diretamente \r\n    ligados à qualidade de vida.</p>\r\n\r\n    <p>\"O que me move é ver o retorno do meu trabalho no sorriso de cada paciente. Elas voltam ao consultório mais felizes \r\n    e com a autoestima renovada\", relata o cirurgião plástico Thomas Benson, de 39 anos, especialista nessa técnica de melhorar \r\n    a vida das pessoas por meio dos bisturis.</p>\r\n\r\n    <p>O jovem médico, que é atualmente o único no Brasil com título de especialista pelo European Board of Plastic Surgery \r\n    (Conselho Europeu de Cirurgia Plástica), chegou a Alphaville pelo caminho de maior credibilidade possível: indicações. \r\n    \"Eu atendia mais na região de São Paulo, mas já tinha pacientes no bairro. Elas começaram a me indicar para outras, que nem \r\n    sempre conseguiam se deslocar até minha clínica na capital\", conta.</p>\r\n\r\n    <p>Foi quando o cirurgião, nascido no Brasil e crescido na Alemanha, decidiu abrir alguns dias na agenda para atender por aqui. \r\n    Mas não pense que ele apenas faz um pré-atendimento. Ele traz a equipe toda: \"Em parceria com a Dra. Karina Nunes, levo minha \r\n    equipe para a Innovare Clinic, que tem uma infraestrutura multidisciplinar necessária para as consultas\", explica.</p>\r\n    <br/>\r\n    `,\n        categories: [\n            \"development\"\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./data/pressgallery.js\n");

